  #info .top{
    padding: 3%;
  }
    @media (min-width:1100px){
      #info .top{
        display: grid;
        grid-template-columns: 0.35fr 0.65fr;
      }
    }


/**
 * 3.1 My Piction
 * -------------------------------------
 */


    #info .top #myPic{
      width: 50%;
      margin: auto;
      position: relative;
      display: grid;
    }
