            border-radius: 60% 17% 30% 41%/ 71% 80% 61% 13%;
          }
          100%{
            border-radius: 35% 47% 49% 21%/ 31% 20% 69% 53%;
          }
        } 
      #info .top #myPic .bg{
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        border-radius: 37% 40% 52% 20%/ 35% 21% 73% 50%;
        background: linear-gradient(35deg, #ff6ee2, #5cd3ff);
        animation: morphinBeforeAni 10s infinite linear;
        z-index: -1;
      }
        @keyframes morphinBeforeAni {
          0% {
            border-radius: 37% 40% 52% 20%/ 35% 21% 73% 50%;
          }
          30% {
            border-radius: 73% 35% 85% 26%/ 58% 63% 31% 67%;
          }
          60% {
            border-radius: 50% 50% 33% 67%/55% 27% 73% 45%;
          }
          80% {
            border-radius: 60% 17% 30% 41%/ 71% 80% 61% 13%;
          }
          100%{
            border-radius: 37% 40% 52% 20%/ 35% 21% 73% 50%;
          }
        }


