 * 3.1 Me
 * -------------------------------------
 */


    #info .top .me {
      text-align: center;
      display: flex;
      justify-content: center;
      align-content: center;
      flex-wrap: wrap;
      padding-top: 2vw;
    }



/**
 * 4.0 Line
 * ----------------------------------------------------------------------------
 */

  #info .line{
    width: 26%;
    height: 0.4rem;
    background: white;
    margin: 6% auto 15% auto;
  }
    @media (min-width:1100px){
      #info .line{
        width: 16%;
      }
    }




/**
 * 5.0 Bot
 * ----------------------------------------------------------------------------
 */


  #info .bot{
    padding:3%;
  }

    #info .bot div{
      padding-bottom: 15%;
    }

      @media (min-width:1100px){
        #info .bot > div{
          display: grid;
          grid-template-columns: 0.4fr 0.60fr;
          /* grid-gap: 4vw; */
        }
      }



/**
 * 5.1 Head
 * -------------------------------------
 */

    #info .bot .heads{
      text-align: center;
      margin: 10%;
    }
      #info .bot .heads::after{
        content: '';
        background: white;
        height: 0.15rem;
        width: calc(100% /10);
        position: relative;
        display: block;
        margin: 1rem auto;
      }
        @media (min-width:1100px){
          #info .bot .heads::after{
            width: calc(100% / 5);
          }
        }


/**
 * 5.2 Bodies
 * -------------------------------------
 */
    #info .bot .bodies{
      align-self: center;
    }
      #info .bot .bodies .school{
        /* margin-bottom: 13%; */
      }

        #info .bot #education .heads{
          overflow-wrap: anywhere;
        }
        #info .bot #contact .bodies{
          width:fit-content;
        }
          #info .bot #contact .bodies .address{
            display: flex;
            margin: 0.7rem 0;
            background: rgb(30,30,30);
            border: solid rgba(255,255,255, 0.6) 2px;
            border-radius: 0.5rem;
          }
            #info .bot #contact .bodies .address *{
              /* display: inline; */
              /* align-self:center; */
              padding: 0.4rem;
            }

            #info .bot #contact .bodies .address a{
              color: white;
              text-decoration: none;
              /* overflow-wrap:anywhere; */
            }

